import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import card from "../components/card";

function Home() {
  return (
    <div>
      <div><Navbar /></div>
      
      <div>
        <Card/>
      </div>

      <div><Footer /></div>
    </div>
  );
}

export default Home;
